import React, { useRef, useState } from "react";
import { Link } from "react-router-dom";
import "./Login.css";

export default function AdminLogin() {
    const [isSigninActive, setIsSigninActive] = useState(true);
    var admin = useRef();
    var pass = useRef();
  const [error,seterror] =useState("");
    function f1(){
        var adminval= admin.current.value;
        var passval = pass.current.value;
        if (adminval =="admin" && passval=="password"){
            <Link to="/admindash"/>
        }else{
            seterror("please enter valid credintials")
        }
        
    }
    

    return (
        <div className="unique-login-page">
            <div className="unique-login-container">
                <div className="unique-form-container">
                <Link to="/about" className="signup-link">Back</Link>
                   <h1 className="unique-form-title">Admin</h1>
                    <h2 className="unique-form-title">Sign In</h2>
                    <form className="unique-form unique-signin-form">
                        <div className="unique-form-group">
                            <label htmlFor="username">Username</label>
                            <input
                                className="unique-form-input"
                                type="text"
                                name="username"
                                placeholder="Enter your username"
                               ref={admin}
                            />
                        </div>
                        <div className="unique-form-group">
                            <label htmlFor="password">Password</label>
                            <input
                                className="unique-form-input"
                                type="password"
                                name="password"
                                placeholder="Enter your password"
                                
                               ref={pass}
                            />
                        </div>
                        <div className="unique-form-options">
                            <label className="unique-checkbox-label">
                                <input type="checkbox" id="keepSignedIn" />
                                Keep me signed in
                            </label>
                        </div>
                        <button type="button" className="unique-form-submit-button" onClick={f1}>Sign In</button>
                    </form>
                   
                </div>
            </div>
        </div>
    );
}
